const LoginPage = () => {
  return (
    <form className='form'>
      <input type='cliente' name='cliente' id='cliente' placeholder='cliente'></input>
      <input type='login' name='login' id='login' placeholder='login'></input>
      <input type='password' name='password' id='password' placeholder='password'></input>
    </form>
  )
}

export default LoginPage
